import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

import { IgrLegendModule, IgrCategoryChartModule } from "igniteui-react-charts";
import { IgrLegend, IgrCategoryChart } from "igniteui-react-charts";
import {
  CountryRenewableElectricityItem,
  CountryRenewableElectricity
} from "./CountryRenewableElectricity";

const mods: any[] = [IgrLegendModule, IgrCategoryChartModule];
mods.forEach((m) => m.register());

export default class Sample2 extends React.Component<any, any> {
  private legend: IgrLegend;
  private legendRef(r: IgrLegend) {
    this.legend = r;
    this.setState({});
  }
  private chart: IgrCategoryChart;
  private chartRef(r: IgrCategoryChart) {
    this.chart = r;
    this.setState({});
  }

  constructor(props: any) {
    super(props);

    this.legendRef = this.legendRef.bind(this);
    this.chartRef = this.chartRef.bind(this);
  }

  public render(): JSX.Element {
    return (
      <div className="container sample  hi">
        <div className="legend-title ">
          Biochemical&nbsp;Oxygen&nbsp;Demand(BOD5)
        </div>

        {/* <div className="legend">
                <IgrLegend
                    orientation="Horizontal"
                    ref={this.legendRef}>
                </IgrLegend>
            </div> */}

        <div className="container fill gradient flexbox">
          <text>
            <br />
            <span className="heading">10.5 mg/l</span>
            <br />
            <span className="heading1">Limits: &lt; 10mg/l </span>
          </text>
          <br />
          <IgrCategoryChart
            chartType="Line"
            yAxisLabelLeftMargin="0"
            yAxisTitleLeftMargin="10"
            yAxisTitleRightMargin="5"
            // yAxisTitle="Temprature "
            dataSource={this.countryRenewableElectricity}
            includedProperties={["year", "Bangalore"]}
            legend={this.legend}
            isHorizontalZoomEnabled="false"
            isVerticalZoomEnabled="false"
            computedPlotAreaMarginMode="Series"
            yAxisMajorStroke="white"
            markerTypes="None"
            yAxisLabel=" "
            ref={this.chartRef}
          ></IgrCategoryChart>
        </div>
      </div>
    );
  }

  private _countryRenewableElectricity: CountryRenewableElectricity = null;
  public get countryRenewableElectricity(): CountryRenewableElectricity {
    if (this._countryRenewableElectricity == null) {
      this._countryRenewableElectricity = new CountryRenewableElectricity();
    }
    return this._countryRenewableElectricity;
  }
}
